pragma solidity ^0.8.12;

contract TestContract {
    uint256[] randomNum = [23, 1, 3, 4];

    function findPosition(uint256 x) public view returns (uint256) {
        for (uint256 i = 0; i < randomNum.length; i++) {
            if (x == randomNum[i]) {
                return i;
            }
        }
    }
}
